import React, { useState, useEffect } from 'react';
import { FixedSizeList as List } from 'react-window';
import { getAllApplications } from '../services/jobApplicationService';
import EditModal from './EditModal';

const JobApplicationTable2 = () => {
    const [applications, setApplications] = useState([]);
    const [selectedApplication, setSelectedApplication] = useState(null);
    const [isModalOpen, setIsModalOpen] = useState(false);

    useEffect(() => {
        const fetchApplications = async () => {
            try {
                const data = await getAllApplications();
                setApplications(data);
            } catch (error) {
                console.log('Error fetching applications:', error);
            }
        };

        fetchApplications();
    }, []);

    const handleEditClick = (application) => {
        setSelectedApplication(application);
        setIsModalOpen(true);
    };

    const handleDelete = (id) => {
        console.log('Delete feature triggered for ID:', id);
    };

    const handleModalClose = () => {
        setSelectedApplication(null);
        setIsModalOpen(false);
    };

    const Row = ({ index, style }) => {
        const application = applications[index];

        return (
            <tr style={style} key={application.id}>
                <td>{application.company}</td>
                <td>{application.role}</td>
                <td>{application.location}</td>
                <td>{application.pay_range}</td>
                <td>{application.source}</td>
                <td>{application.date}</td>
                <td>{application.call}</td>
                <td>{application.progress}</td>
                <td>
                    <button
                        className="btn btn-primary"
                        onClick={() => handleEditClick(application)}
                    >
                        Edit
                    </button>
                </td>
                <td>
                    <button
                        className="btn btn-danger"
                        onClick={() => handleDelete(application.id)}
                    >
                        Delete
                    </button>
                </td>
                {/* Conditionally render the modal inside the row */}
                {isModalOpen && selectedApplication?.id === application.id && (
                    <EditModal
                        application={selectedApplication}
                        onClose={handleModalClose}
                    />
                )}
            </tr>
        );
    };

    return (
        <div className="container mt-5">
            <h1 className="text-center">Job Applications</h1>
            <div className="table-responsive">
                <table className="table table-dark table-hover text-center">
                    <thead className="thead-light">
                        <tr>
                            <th>Company</th>
                            <th>Role</th>
                            <th>Location</th>
                            <th>Pay Range</th>
                            <th>Source</th>
                            <th>Date</th>
                            <th>Call</th>
                            <th>Progress</th>
                            <th>Edit</th>
                            <th>Delete</th>
                        </tr>
                    </thead>
                    <tbody>
                        <List
                            height={700} // Height of the visible table area
                            itemCount={applications.length} // Total number of rows
                            itemSize={50} // Row height
                            width="2500%" // Width of the table
                        >
                            {Row}
                        </List>
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default JobApplicationTable2;
